INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 102301, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, 24, 0.0, "2020/07/31 12:00:00", 24001, 10046, 2, 0.0, "アヤネ", 401, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 102301, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 1, 24, 0.0, "2020/07/31 12:00:00", 24002, 10046, 2, 2.21, "アヤネ", 402, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 102301, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, 24, 0.0, "2020/07/31 12:00:00", 24003, 10046, 2, 0.0, "アヤネ", 403, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 192201, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 2, 24, 0.0, "2020/07/31 12:00:00", 24004, 10046, 1, 1.99, "アサヒ", 701, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 192201, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 1, 24, 0.0, "2020/07/31 12:00:00", 24005, 10046, 2, 2.21, "アサヒ", 702, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 192201, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 2, 24, 0.0, "2020/07/31 12:00:00", 24006, 10046, 1, 3.33, "アサヒ", 703, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 192301, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, 24, 0.0, "2020/07/31 12:00:00", 24007, 10046, 2, 0.0, "部員３", 801, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 192301, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 1, 24, 0.0, "2020/07/31 12:00:00", 24008, 10046, 2, 2.68, "部員３", 802, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 192301, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, 24, 0.0, "2020/07/31 12:00:00", 24009, 10046, 2, 0.0, "部員３", 803, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 192501, "やった！", 1, 24, 0.0, "2020/07/31 12:00:00", 24010, 10046, 1, 0.0, "", 501, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 192501, "勝ったよ！", 1, 24, 0.0, "2020/07/31 12:00:00", 24011, 10046, 1, 0.0, "", 502, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 192501, "いい調子！", 1, 24, 0.0, "2020/07/31 12:00:00", 24012, 10046, 1, 0.0, "", 503, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 113501, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 6, 24, 0.0, "2020/07/31 12:00:00", 24013, 10046, 2, 5.33, "ミサト", 111, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 113501, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 1, 24, 0.0, "2020/07/31 12:00:00", 24014, 10046, 2, 6.85, "ミサト", 112, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 113501, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 1, 24, 0.0, "2020/07/31 12:00:00", 24015, 10046, 2, 3.0, "ミサト", 113, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 192401, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 1, 24, 0.0, "2020/07/31 12:00:00", 24016, 10046, 2, 6.11, "ダイチ", 611, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 192401, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 1, 24, 0.0, "2020/07/31 12:00:00", 24017, 10046, 2, 6.75, "ダイチ", 612, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 192401, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, 24, 0.0, "2020/07/31 12:00:00", 24018, 10046, 2, 0.0, "ダイチ", 613, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 113401, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 2, 24, 0.0, "2020/07/31 12:00:00", 24019, 10046, 1, 4.52, "ハツネ", 211, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 113401, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 2, 24, 0.0, "2020/07/31 12:00:00", 24020, 10046, 1, 3.89, "ハツネ", 212, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 113401, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 1, 24, 0.0, "2020/07/31 12:00:00", 24021, 10046, 2, 13.49, "ハツネ", 213, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 106501, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 1, 24, 0.0, "2020/07/31 12:00:00", 24022, 10046, 2, 3.17, "カヤ", 311, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 106501, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 1, 24, 0.0, "2020/07/31 12:00:00", 24023, 10046, 2, 4.42, "カヤ", 312, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 106501, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 6, 24, 0.0, "2020/07/31 12:00:00", 24024, 10046, 1, 2.89, "カヤ", 313, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 102301, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 4, 24, 0.0, "2020/07/31 12:00:00", 24025, 10046, 3, 3.71, "アヤネ", 421, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 192201, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 2, 24, 0.0, "2020/07/31 12:00:00", 24026, 10046, 1, 5.1, "アサヒ", 721, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 192301, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 1, 24, 0.0, "2020/07/31 12:00:00", 24027, 10046, 3, 4.34, "部員３", 821, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 192501, "いい勝負だったよ\nまたやろうね", 1, 24, 0.0, "2020/07/31 12:00:00", 24028, 10046, 1, 0.0, "", 521, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 113501, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 1, 24, 0.0, "2020/07/31 12:00:00", 24029, 10046, 2, 5.62, "ミサト", 101, -360.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 113501, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 1, 24, 0.0, "2020/07/31 12:00:00", 24030, 10046, 2, 9.58, "ミサト", 102, -360.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 113501, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, 24, 0.0, "2020/07/31 12:00:00", 24031, 10046, 2, 0.0, "ミサト", 103, -360.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 113501, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 2, 24, 0.0, "2020/07/31 12:00:00", 24032, 10046, 1, 9.13, "ミサト", 104, -360.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 113501, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 1, 24, 0.0, "2020/07/31 12:00:00", 24033, 10046, 2, 8.27, "ミサト", 105, -360.0);
